import { Link } from "react-router-dom";
import style from '../Landing/Landing.module.css';


export default function Landing () {
    return (
     <>
        <div className={style.container}>


        <div>
        <Link to = '/home'>
         <button className={style.enter}>Enter</button>
        </Link>
        </div>

       </div>

     </>
    );
};


